var Cons = function(){
    var self = this;
    self.data = [
        {id:50, code:'MAIN', url:"http://www.versou.com:8080", des:"主站"},
        {id:100, code:'FILE', url:"http://file.versou.com:8081", des:"文件服务器"}
    ];

    self.id = {};

    for(var i = 0; i < self.data.length; i++)
    {
        var set = self.data[i];
        self[set.code] = set;

        self.id[set.id] = set;
    }
};
module.exports = new Cons();